INSERT INTO `makanan` (`kode`, `nama`, `deskripsi`, `img`, `harga`) VALUES
('MK008', 'Cappuccino', 'Cappuccino adalah minuman khas Italia yang dibuat dari espresso dan susu, namun referensi lain juga ada yang menyebutkan bahwa Cappuccino berawal dari biji biji kopi tentara Turki yang tertinggal setelah peperangan yang di pimpin oleh Kara Mustapha Pasha di Wina, Austria melawan tentara gabungan Polandia-Germania. Cappuccino biasanya didefinisikan sebagai 1/3 espresso, 1/3 susu yang dipanaskan dan 1/3 susu yang dikocok hingga berbusa. Definisi yang lain menyebutkan 1/3 espresso dan 2/3 mikrofoam.', , '20000');
INSERT INTO `makanan` (`kode`, `nama`, `deskripsi`, `img`, `harga`) VALUES
('MK009', 'Coffee Latte', 'Banyak orang yang kurang bisa membedakan antara cappucino dan latte karena kedua jenis minuman kopi ini memiliki bahan dasar yang sama, yaitu espresso dan susu. Namun yang membedakan adalah komposisi susu dan kopi pada latte adalah 3:1 sehingga cita rasa susu pada minuman kopi ini lebih terasa. Selain itu, lapisan busa pada latte juga terlihat tipis. Bagi Toppers yang tidak ingin minum kopi yang terlalu tinggi kadar kopinya, jenis kopi latte bisa dijadikan pilihan. Terlebih, kopi latte kini punya banyak rasa yang bisa kamu coba seperti vanilla, caramel, hazelnut. \r\n', , '20000');
INSERT INTO `makanan` (`kode`, `nama`, `deskripsi`, `img`, `harga`) VALUES
('MK010', 'Hot Red Velvet', 'Rasa red velvet yang menjadi primadona pecinta kuliner. Sesuai namanya, warna merah-kecoklatan menjadi ciri khasnya. Pada dasarnya red velvet adalah nama jenis cake. Namun, citarasa dan warnanya yang didapat dari buah bit itu semakin populer dan membuat para pembuat dessert menemukan peluang lain dari citarasanya. Kini, Anda bisa menemui red velvet tidak dalam bentuk cake, tapi berbentuk minuman. Yaitu perpaduan powder dan Susu panas ,disajikan dengan gambar yang lucu lucu. ', , '18000');
INSERT INTO `makanan` (`kode`, `nama`, `deskripsi`, `img`, `harga`) VALUES
('MK011', 'Hot Matcha', 'Matcha (??, teh bubuk) adalah teh hijau berbentuk bubuk yang dibuat dari menggiling teh hijau hingga halus seperti tepung. Minuman ini sama dengangan redvelvet Yaitu perpaduan powder dan Susu panas ,disajikan dengan gambar yang lucu lucu.', , '18000');
INSERT INTO `makanan` (`kode`, `nama`, `deskripsi`, `img`, `harga`) VALUES
('MK012', 'Hot Taro', 'Taro? Yap! Taro adalah sebutan lain untuk umbi-umbian bernama talas. Jadi, taro yang ini bukan salah satu jenis snack yang banyak dijual di toko, ya. Hehehe. Nah, saat ini, taro juga lagi cukup digandrungi seperti green tea. Banyak olahan makanan dan minuman di kafe-kafe menggunakan taro sebagai bahan utamanya, salah satunya adalah taro latte\r\n', , '18000');

